import React from 'react';
import Icon1 from "./icons/icon1.png";
import Icon2 from "./icons/icon2.png";
import Icon3 from "./icons/icon3.png";


const PRICING = [
    {
        name:"Personal" ,
        features:"custom domains",
        description:"Sleeps after 30 mins of inactivity",
        cost: "Free",
        buttonName: "Sign Up",
        icon:Icon1,
    },
    {

        name:"Small team" ,
        features:"Never sleeps",
        description:"Multiple workers for more powerful apps",
        cost: "Free",
        buttonName: "Sign Up",
        icon:Icon2,
    },
    {
        name:"Enterprise",
        features:"Dedicated",
        description:"Simple horizontal scalability",
        cost: "$400",
        buttonName: "Free trial",
        icon:Icon3,
    },
];

function App() {
    return (
        <div className='container mx-auto px-16 py-24 border p-5 gap-16 '>
            <div className="grid grid-cols-3 gap-16">
                {PRICING.map((pricing) => (
                    <div className="border rounded-lg p-5">
                        <div className="mb-8">
                           {pricing.icon}
                        </div>
                        <h3 className='text-xl font-semibold  mb-4'>{pricing.name}</h3>
                        <p className='text-md'>{pricing.features}</p>
                        <p className='text-md'>{pricing.description}</p>
                        <p className='text-md'>{pricing.cost}</p>
                        <button className='text-md'>{pricing.buttonName}</button>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default App;
